extrin, cocoa powder (2.5%), thickeners (407, 1442, 415), vegetable oil, glucose syrup solids, flavour, Minerals (Magnesium Oxide, Ferrous Sulphate, Zinc Sulphate, Potassium Iodine), Vitamins (C, E, Niacin, A, D, B6, B1, B2, B12, Folate), emulsifiers (471, soy lecithin).<strong></strong>\r\n<h3>Additional Ingredients for each flavour:</h3>\r\n<ul>\r\n	<li>Chocolate Flavour: Cocoa Powder</li>\r\n	<li>Banana Flavour: Colours (102, 110)</li>\r\n	<li>Vanilla Flavour: Colours (102, 110)</li>\r\n	<li>Butterscotch Flavour: Colours (102, 124, 150c)</li>\r\n	<li>Berry Flavour: Colours (120, 133)</li>\r\n</ul>\r\nContains Ingredients Derived From Milk, Wheat &amp; Soy.\r\n<h3 class=\"p1\">Nutritional Information</h3>\r\n<table border=\"1\" width=\"50%\" cellpadding=\"10\">\r\n<thead>\r\n<tr>\r\n<td colspan=\"5\" width=\"164\">\n\n<strong>NUTRITION INFORMATION</strong>\r\n\r\nServing size: 52g</td>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td width=\"164\"><strong></strong></td>\r\n<td width=\"78\"><strong>Average Quantity Per 55g Serviing</strong></td>\r\n<td width=\"35\"><strong></strong></td>\r\n<td width=\"92\"><strong>Average Quantity per 100g Serving</strong></td>\r\n<td width=\"50\"><strong></strong></td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>ENERGY</strong></td>\r\n<td width=\"78\">872</td>\r\n<td width=\"35\">kJ</td>\r\n<td width=\"92\">1680</td>\r\n<td width=\"50\">kJ</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>PROTEIN</strong></td>\r\n<td width=\"78\">17.2</td>\r\n<td width=\"35\">g</td>\r\n<td width=\"92\">33.1</td>\r\n<td width=\"50\">g</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>FAT, TOTAL</strong></td>\r\n<td width=\"78\">2.2</td>\r\n<td width=\"35\">g</td>\r\n<td width=\"92\">4.2</td>\r\n<td width=\"50\">g</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>- SATURATED</strong></td>\r\n<td width=\"78\">1</td>\r\n<td width=\"35\">g</td>\r\n<td width=\"92\">1.9</td>\r\n<td width=\"50\">g</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>CARBOHYDRATE</strong></td>\r\n<td width=\"78\">29.3</td>\r\n<td width=\"35\">g</td>\r\n<td width=\"92\">56.3</td>\r\n<td width=\"50\">g</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>- SUGARS</strong></td>\r\n<td width=\"78\">24.1</td>\r\n<td width=\"35\">g</td>\r\n<td width=\"92\">46.4</td>\r\n<td width=\"50\">g</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>SODIUM</strong></td>\r\n<td width=\"78\">184</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">354</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>POTASSIUM</strong></td>\r\n<td width=\"78\">460</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">884</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Vitamin A</strong></td>\r\n<td width=\"78\">192</td>\r\n<td width=\"35\">g</td>\r\n<td width=\"92\">370</td>\r\n<td width=\"50\">g</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Thiamin</strong></td>\r\n<td width=\"78\">0.3</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">0.5</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Riboflavin</strong></td>\r\n<td width=\"78\">0.6</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">1.2</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Niacin</strong></td>\r\n<td width=\"78\">2.6</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">5</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Folate</strong></td>\r\n<td width=\"78\">52</td>\r\n<td width=\"35\">g</td>\r\n<td width=\"92\">100</td>\r\n<td width=\"50\">g</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Vitamin B6</strong></td>\r\n<td width=\"78\">0.4</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">0.8</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Vitamin B12</strong></td>\r\n<td width=\"78\">1</td>\r\n<td width=\"35\">g</td>\r\n<td width=\"92\">1.9</td>\r\n<td width=\"50\">g</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Vitamin C</strong></td>\r\n<td width=\"78\">10</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">20</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Vitamin D</strong></td>\r\n<td width=\"78\">2.6</td>\r\n<td width=\"35\">g</td>\r\n<td width=\"92\">4.9</td>\r\n<td width=\"50\">g</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Vitamin E</strong></td>\r\n<td width=\"78\">2.6</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">4.9</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Calcium</strong></td>\r\n<td width=\"78\">400</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">769</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Iron</strong></td>\r\n<td width=\"78\">3.1</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">6</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Iodine</strong></td>\r\n<td width=\"78\">38</td>\r\n<td width=\"35\">g</td>\r\n<td width=\"92\">73</td>\r\n<td width=\"50\">g</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Magnesium</strong></td>\r\n<td width=\"78\">82</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">158</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Phosphorous</strong></td>\r\n<td width=\"78\">299</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">575</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Zinc</strong></td>\r\n<td width=\"78\">3</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">5.8</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\";s:10:\"post_title\";s:24:\"Variety Pack x 20 Shakes\";s:12:\"post_excerpt\";s:689:\"<p class=\"p1\">[customer]The Kate Morgan Variety Pack contains 20 x 52 g Meal Replacement Shake sachets:</p>\r\n\r\n<ul>\r\n	<li class=\"p1\">4 x Chocolate,</li>\r\n	<li class=\"p1\">4 x Berry</li>\r\n	<li class=\"p1\">4 x Vanilla</li>\r\n	<li class=\"p1\">4 x Banana</li>\r\n	<li