s:2:\"ID\";i:31;s:11:\"post_author\";s:1:\"1\";s:9:\"post_date\";s:19:\"2015-04-20 02:55:46\";s:13:\"post_date_gmt\";s:19:\"2015-04-19 16:55:46\";s:12:\"post_content\";s:5655:\"<h3 class=\"p1\">Directions for use:</h3>\r\n<ul>\r\n	<li class=\"p1\">Add 200  250 mL of cold water to a Shaker.<span class=\"Apple-converted-space\"> </span>Add the contents of a Kate Morgan Sachet and shake until the contents of the sachet are fully dissolved.<span class=\"Apple-converted-space\"> </span>Add more or less water to suit your taste.</li>\r\n	<li class=\"p1\">Simply replace two meals a day with Kate Morgan Meal Replacement Shakes, Bars, European Cremes or Soups.<span class=\"Apple-converted-space\"> </span>Enjoy one healthy meal and 1 snack per day.</li>\r\n</ul>\r\n<h3>Main ingredients (all flavours):</h3>\r\nMilk Solids, Fructose, Maltodextrin, cocoa powder (2.5%), thickeners (407, 1442, 415), vegetable oil, glucose syrup solids, flavour, Minerals (Magnesium Oxide, Ferrous Sulphate, Zinc Sulphate, Potassium Iodine), Vitamins (C, E, Niacin, A, D, B6, B1, B2, B12, Folate), emulsifiers (471, soy lecithin).\r\n<h3>Additional Ingredients for each flavour:</h3>\r\n<ul>\r\n	<li>Chocolate Flavour: Cocoa Powder</li>\r\n	<li>Banana Flavour: Colours (102, 110)</li>\r\n	<li>Vanilla Flavour: Colours (102, 110)</li>\r\n	<li>Butterscotch Flavour: Colours (102, 124, 150c)</li>\r\n	<li>Berry Flavour: Colours (120, 133)</li>\r\n</ul>\r\nContains Ingredients Derived From Milk, Wheat &amp; Soy.\r\n<h3 class=\"p1\">Nutritional Information:</h3>\r\n<table border=\"1\" width=\"50%\" cellpadding=\"10px\">\r\n<thead>\r\n<tr>\r\n<td colspan=\"5\" width=\"164\">\n\n<strong>NUTRITION INFORMATION</strong>\r\n\r\n<strong>Serving size: 52g</strong></td>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td width=\"164\"><strong></strong></td>\r\n<td width=\"78\"><strong>Average Quantity Per 55g Serviing</strong></td>\r\n<td width=\"35\"><strong></strong></td>\r\n<td width=\"92\"><strong>Average Quantity per 100g Serving</strong></td>\r\n<td width=\"50\"><strong></strong></td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>ENERGY</strong></td>\r\n<td width=\"78\">872</td>\r\n<td width=\"35\">kJ</td>\r\n<td width=\"92\">1680</td>\r\n<td width=\"50\">kJ</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>PROTEIN</strong></td>\r\n<td width=\"78\">17.2</td>\r\n<td width=\"35\">g</td>\r\n<td width=\"92\">33.1</td>\r\n<td width=\"50\">g</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>FAT, TOTAL</strong></td>\r\n<td width=\"78\">2.2</td>\r\n<td width=\"35\">g</td>\r\n<td width=\"92\">4.2</td>\r\n<td width=\"50\">g</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>- SATURATED</strong></td>\r\n<td width=\"78\">1</td>\r\n<td width=\"35\">g</td>\r\n<td width=\"92\">1.9</td>\r\n<td width=\"50\">g</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>CARBOHYDRATE</strong></td>\r\n<td width=\"78\">29.3</td>\r\n<td width=\"35\">g</td>\r\n<td width=\"92\">56.3</td>\r\n<td width=\"50\">g</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>- SUGARS</strong></td>\r\n<td width=\"78\">24.1</td>\r\n<td width=\"35\">g</td>\r\n<td width=\"92\">46.4</td>\r\n<td width=\"50\">g</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>SODIUM</strong></td>\r\n<td width=\"78\">184</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">354</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>POTASSIUM</strong></td>\r\n<td width=\"78\">460</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">884</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Vitamin A</strong></td>\r\n<td width=\"78\">192</td>\r\n<td width=\"35\">g</td>\r\n<td width=\"92\">370</td>\r\n<td width=\"50\">g</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Thiamin</strong></td>\r\n<td width=\"78\">0.3</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">0.5</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Riboflavin</strong></td>\r\n<td width=\"78\">0.6</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">1.2</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Niacin</strong></td>\r\n<td width=\"78\">2.6</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">5</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Folate</strong></td>\r\n<td width=\"78\">52</td>\r\n<td width=\"35\">g</td>\r\n<td width=\"92\">100</td>\r\n<td width=\"50\">g</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Vitamin B6</strong></td>\r\n<td width=\"78\">0.4</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">0.8</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Vitamin B12</strong></td>\r\n<td width=\"78\">1</td>\r\n<td width=\"35\">g</td>\r\n<td width=\"92\">1.9</td>\r\n<td width=\"50\">g</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Vitamin C</strong></td>\r\n<td width=\"78\">10</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">20</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Vitamin D</strong></td>\r\n<td width=\"78\">2.6</td>\r\n<td width=\"35\">g</td>\r\n<td width=\"92\">4.9</td>\r\n<td width=\"50\">g</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Vitamin E</strong></td>\r\n<td width=\"78\">2.6</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">4.9</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Calcium</strong></td>\r\n<td width=\"78\">400</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">769</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Iron</strong></td>\r\n<td width=\"78\">3.1</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">6</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Iodine</strong></td>\r\n<td width=\"78\">38</td>\r\n<td width=\"35\">g</td>\r\n<td width=\"92\">73</td>\r\n<td width=\"50\">g</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Magnesium</strong></td>\r\n<td width=\"78\">82</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">158</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Phosphorous</strong></td>\r\n<td width=\"78\">299</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">575</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n<tr>\r\n<td width=\"164\"><strong>Zinc</strong></td>\r\n<td width=\"78\">3</td>\r\n<td width=\"35\">mg</td>\r\n<td width=\"92\">5.8</td>\r\n<td width=\"50\">mg</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\";s:10:\"post_title\";s:38:\"Commitment Pack x 112 Shakes (8 weeks)\";s:12:\"post_excerpt\";s:861:\"The Kate Morgan 8 week Serious Commitment Pack contains 112 x 52g Meal Replacement Shakes, Food Guide, Program Guide and Shaker. The flavours are:\r\n<ul>\r\n	<li>16 x Chocolate</li>\r\n	<li>16 x Vanilla</li>\r\n	<li>16 x Berry</li>\r\n	<li>16 x Banana</li>\r\n	<li>16 x Butterscotch</li>\r\n	<li>16 x Cappucinno</li>\r\n	<li>16 x Pine Lime</li>\r\n</ul>\r\nPlease note that the mix can be varied to suit your requirements. Please email <a href=\"mailto:admin@katemorgan.com.au\">admin@katemorgan.com.au</a> if you would like to alter the mix of shake flavours.\r\n\r\nKate Morgan Meal Replacement Shake sachets are heavily fortified with all of the vitamins and minerals that your body needs to stay healthy while you lose weight. They are part of a nutritionally balanced weight loss program and taste great, keeping you fuller for longer. Contents of one sachet replaces one meal.\";s:11:\"post_status\";s:7:\"publish\";s:14:\"comment_status\";s:6:\"closed\";s:11:\"ping_status\";s:6:\"closed\";s:13:\"post_password\";s:0:\"\";s:9:\"post_name\";s:30:\"8-week-serious-commitment-pack\";s:7:\"to_ping\";s:0:\"\";s:6:\"pinged\";s:0:\"\";s:13:\"post_modified\";s:19:\"2015-08-13 16:48:24\";s:17:\"post_modified_gmt\";s:19:\"2015-08-13 06:48:24\";s:21:\"post_content_filtered\";s:0:\"\";s:11:\"post_parent\";i:0;s:4:\"guid\";s:64:\"http://174.121.78.227/~kmxmarketing/?post_type=product&#038;p=31\";s:10:\"menu_order\";i:13;s: